import React from 'react';
import '../../stylesheets/WaiterView/ButtonsAddLess.css';

const TableBody = () => {
    return (
    <tbody>
    <tr>
    <th></th>
    <th></th>
    <th>$</th>
    <th><button ><i className="icon-minus"></i></button>
    <button ><i className="icon-trash"></i></button>
    </th>
    </tr>
    </tbody>
    )
}
export default TableBody;
